import React  from "react";

const What=(state)=>{
     const {items} = state;
  
return          
  (
    items.map=(item=>{
        return(
            <div>
<p>{item.id}</p>
{item.name}
{item.age}
            </div>

        )
}
    )
)        
    
}
export default What;
